// Sidebar.js
import { Link } from "react-router-dom";
import {
  FaPhone,
  FaEnvelope,
  FaMapMarkerAlt,
  FaTachometerAlt,
  FaUsers,
} from "react-icons/fa"; // Import FaUsers for the Employee List icon

const Sidebar = () => {
  return (
    <aside className="w-64 absolute left-0 bg-gray-800 text-white h-full p-4">
      <nav className="space-y-4">
        {/* Dashboard Link */}
        <Link
          to="/"
          className="flex text-[20px] items-center space-x-2 p-2 hover:bg-gray-700 rounded"
        >
          <FaTachometerAlt className="text-yellow-400" />
          <span>Dashboard</span>
        </Link>

        {/* Call Log Link */}
        <Link
          to="/call-log"
          className="flex text-[20px] items-center space-x-2 p-2 hover:bg-gray-700 rounded"
        >
          <FaPhone className="text-blue-400" />
          <span>Call Log</span>
        </Link>

        {/* Messages Link */}
        <Link
          to="/messages"
          className="flex text-[20px] items-center space-x-2 p-2 hover:bg-gray-700 rounded"
        >
          <FaEnvelope className="text-green-400" />
          <span>Messages</span>
        </Link>

        {/* Location Link */}
        <Link
          to="/location"
          className="flex text-[20px] items-center space-x-2 p-2 hover:bg-gray-700 rounded"
        >
          <FaMapMarkerAlt className="text-red-400" />
          <span>Location</span>
        </Link>

        {/* Employee List Link */}
        <Link
          to="/employees"
          className="text-[20px] flex items-center space-x-2 p-2 hover:bg-gray-700 rounded"
        >
          <FaUsers className="text-purple-400" />{" "}
          {/* You can customize the color */}
          <span>Employee List</span>
        </Link>
      </nav>
    </aside>
  );
};

export default Sidebar;
